                <p class=""description""> 
                    Computer science are an important economic sector for our country, generating highly skilled jobs. The activities of operators and SME focus on
                    data processing developments: networks, internet of things, cloud, TOIP, video streaming, etc. Computer science rely heavily on
                    telecommunications networks whose rapid development is due to perpetual innovation in this field (GSM, ADSL, TNT, WIFI, etc.). As physical
