                <p class=""description""> 
                    <strong> Commun run to the mention </strong><br/>
                    The master’s degree provides high-level knowledge in the field of wide area network architecture and security as well as in the Internet of
                    Things. Cloud Computing, Storage, ToIP, Virtualization, Security, Quality of Service, M2M, and Embedded Development are at the heart of the
